        function updateOnlineStatus() {
            if ("boolean" === typeof(navigator["onLine"])) {
                if (navigator.onLine) {
                    this.hideError();
                    if(bot && bot.RtmClient){
                            bot.getHistory({forHistorySync:true,limit:30});                           
                    }

                } else {
                    this.showError("You are currently offline")
                }
            }
        }

