	customTemplate.prototype.getColumnWidth = function (width) {
		var _self = this;
		var newWidth;
		var widthToApply = '100%';
	  if (width){
		newWidth = width.replace(/[^\d.-]/g, '');
		 console.log(width)
		try {
		  widthToApply = 100 - parseInt(newWidth, 10);
		} catch (e){
		console.log(width);
		}
		return widthToApply;
	   }
	  };
